import { feedbackDataApi,feedbackFromApi } from '@/api/kefu.js'
export default{
	name:'feedback',
	data(){
		return {
			name:'',
			phone:'',
			con:'',
			feedback:'',
			isDisabled:false
		}
	},
	created(){
		this.getInfo()
	},
	methods:{
		getInfo(){
			feedbackDataApi().then(res=>{
				this.feedback = res.data.feedback
			})
		},
		subMit(){
			if(!this.name){
				return this.$Message.error('请填写姓名')
			}
			if(!this.phone || !(/^1(3|4|5|7|8|9|6)\d{9}$/i.test(this.phone))){
				return this.$Message.error('请填写正确的手机号码')
			}
			if(!this.con){
				return this.$Message.error('请填写内容')
			}
			this.isDisabled = true
			feedbackFromApi({
				rela_name:this.name,
				phone:this.phone,
				content:this.con
			}).then(res=>{
				this.$Message.success(res.msg)
				this.$router.go(-1)
			}).catch(error=>{
				this.$Message.error(error.msg)
			})
		}
	}
}
